// eslint-disable-next-line import/no-anonymous-default-export
var self = this;
export default () => {
    // eslint-disable-line no-restricted-globals
    self.addEventListener("message", message => {

        if (!message) return;

        const stop = message.data[1]

        var startNode, stopNode, finishNode

        message.data[0].map((node) => {

            if(node.isStart === true) startNode = node

            if(node.isStop === true) stopNode = node

            if(node.isFinish === true) finishNode = node
        })
        console.log(startNode, stopNode, finishNode, stop)

        var nodesInShortestPathOrder = [];

        if(!stop) {

            let currentNode = finishNode

            while (currentNode !== null) {

                if(currentNode.isStart==true) break;

                nodesInShortestPathOrder.unshift(currentNode);
                currentNode = currentNode.previousNode;
            }

            postMessage(nodesInShortestPathOrder)
        } else {
            var firstPath = []
            var secondPath = []
            var finishNode = message.data[0][0]
            var stopNode = message.data[0][1]

            console.log(finishNode, stopNode)

            postMessage([...firstPath, ...secondPath.reverse()])
        }
    })
}
